const initialState = {
    products: [
        {
            id: 1,
            name: "Mohammed Rashid ms",
            job: "Programmer"
        },
    ]
}

export const productReducer = (state, { type, payload }) => {
    switch (type) {
        case ActionTypes.SET_PRODUCTS:
            return state;
        default:
            return state

    }
}
